import React, { useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import AdminTemplate from "../../../templates/AdminTemplate";
import useMascotaViewModel from "../../../viewmodels/useMascotaViewModel";
import Button from "../../../components/atoms/Button";

const NuevaMascota = () => {
  const navigate = useNavigate();
  const location = useLocation();

  // ============================
  // 游댠 Obtener RUT desde ?rut=
  // ============================
  const query = new URLSearchParams(location.search);
  const rutCliente = query.get("rut");

  // ViewModel conectado al rut din치mico
  const { createMascota } = useMascotaViewModel(rutCliente);

  // Formulario
  const [formData, setFormData] = useState({
    nombre: "",
    especie: "",
    raza: "",
    edad: "",
    peso: "",
  });

  if (!rutCliente) {
    return (
      <AdminTemplate>
        <main className="flex-grow-1 p-5">
          <h4 className="text-danger">Error: No se especific칩 el RUT del cliente.</h4>
          <p>Ingresa desde la lista de mascotas.</p>
        </main>
      </AdminTemplate>
    );
  }

  // ==========================
  // Manejadores
  // ==========================
  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData((prev) => ({ ...prev, [id]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const nueva = await createMascota(formData);

    if (nueva) {
      navigate(`/admin/clientes/mascotas/listar?rut=${rutCliente}`);
    }
  };

  return (
    <AdminTemplate>
      <main className="flex-grow-1" id="main-content">
        <div className="container-fluid py-4">

          {/* Breadcrumb */}
          <nav aria-label="breadcrumb" className="mb-3">
            <ol className="breadcrumb mb-0">
              <li className="breadcrumb-item"><a href="/Admin">Administraci칩n</a></li>
              <li className="breadcrumb-item">
                <a href={`/admin/clientes/mascotas/listar?rut=${rutCliente}`}>
                  Mascotas
                </a>
              </li>
              <li className="breadcrumb-item active" aria-current="page">
                Nueva Mascota
              </li>
            </ol>
          </nav>

          <div className="bg-white p-4 shadow-sm rounded">
            <h1 className="h4 mb-3">Registrar Mascota</h1>

            {/* FORMULARIO */}
            <form onSubmit={handleSubmit}>

              {/* Nombre */}
              <div className="mb-3">
                <label htmlFor="nombre">Nombre *</label>
                <input
                  type="text"
                  id="nombre"
                  required
                  className="form-control"
                  value={formData.nombre}
                  onChange={handleChange}
                />
              </div>

              {/* Especie */}
              <div className="mb-3">
                <label htmlFor="especie">Especie *</label>
                <input
                  type="text"
                  id="especie"
                  required
                  className="form-control"
                  value={formData.especie}
                  onChange={handleChange}
                />
              </div>

              {/* Raza */}
              <div className="mb-3">
                <label htmlFor="raza">Raza *</label>
                <input
                  type="text"
                  id="raza"
                  required
                  className="form-control"
                  value={formData.raza}
                  onChange={handleChange}
                />
              </div>

              {/* Edad */}
              <div className="mb-3">
                <label htmlFor="edad">Edad *</label>
                <input
                  type="number"
                  id="edad"
                  required
                  className="form-control"
                  value={formData.edad}
                  onChange={handleChange}
                />
              </div>

              {/* Peso */}
              <div className="mb-3">
                <label htmlFor="peso">Peso (kg) *</label>
                <input
                  type="number"
                  id="peso"
                  required
                  className="form-control"
                  value={formData.peso}
                  onChange={handleChange}
                />
              </div>

              <Button label="Registrar Mascota" type="submit" variant="primary" />
            </form>
          </div>
        </div>
      </main>
    </AdminTemplate>
  );
};

export default NuevaMascota;
